import React, {useState} from 'react';
import Navbar from './components/Navbar.js';
import BottomBar from './components/BottomBar.js';
import MainPage from './components/MainPage.js';

import './styles/apps.css';


function App() {
  //API call to video
  const apiURL = "http://localhost:8080/?startIndex="+{start}+"&count="+{count}
  var [allVid, setAllVid] = useState(['hi','hi']);

  useEffect(() => {
    axios.get(apiURL)
    .then(res=>res.data.data)
    .then(data=>setAllVid(data))
    .then(console.log(allVid))
  })

  return (
    <div>
      <Navbar/>
      <BottomBar/>
      <MainPage/>
    </div>
  );
}

export default App;
